import React, { Component } from "react";
// css
import "../assets/scss/header.scss";

export default class Header extends React.Component {
  state = {};
  componentDidMount() {}

  render() {
    return (
      <header className="header">
        <div className="header-content">
          <h1>UniU</h1>
          <a href="\">Link 1</a>
          <a href="\">Link 2</a>
          <a href="\">Link 3</a>
        </div>
      </header>
    );
  }
}
